(183, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:95:\"How to Become a Better Data-Driven Marketer  Takeaways From Our Webinar With Kieran Flanagan\";s:7:\"excerpt\";s:164:\"What data do web creators need to collect on their customers, and how can they acquire it? Here are the main takeaways from our webinar with HubSpot\'s VP marketing.\";s:7:\"created\";i:1596524112;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/webinar-kieran-flanagan/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:64:\"Principles of Website Design Every Web Professional Should Know \";s:7:\"excerpt\";s:273:\"Design is by no means an exact science. However, there are many useful principles and rules-of-thumb that can help make your projects better in terms of both usability and aesthetics. In this article, well explain what design principles are and why you should know them.\";s:7:\"created\";i:1596444610;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/principles-of-website-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:56:\"6 Best WooCommerce Hosting Providers for All Store Sizes\";s:7:\"excerpt\";s:249:\"Your WooCommerce hosting plays an important role in the success of your online store, ensuring that shoppers have a smooth shopping experience. To help you choose the right hosting, we\'ve collected the best WooCommerce hosting providers in one spot.\";s:7:\"created\";i:1596016613;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/woocommerce-hosting/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:29:\"Meet Our Leaders: Chris Ayers\";s:7:\"excerpt\";s:235:\"His passion for radio led him to web creation and his eclectic interests and troubleshooting skills help to make Elementor one of the best web building tools out there. This month, we introduce to you the guy with the Elementor tattoo!\";s:7:\"created\";i:1595922268;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/meet-our-leaders-chris-ayers/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:33:\"How to Find Your Web Design Niche\";s:7:\"excerpt\";s:214:\"Focusing yourself on one design niche can have several advantages, including increased productivity and profitability. In this article, well discuss why you need to niche down as a web designer and how to do so.\";s:7:\"created\";i:1595490162;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/web-design-niche/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
