(27, 1, '2020-08-03 07:19:53', '2020-08-03 07:19:53', '<h3>Choose the perfect plan</h3>		\n			<h2>$19</h2>		\n			<h2>Packages</h2>		\n					<ul>\n							<li >\n										For Party\n									</li>\n								<li >\n										Include Hairdo\n									</li>\n								<li >\n										Makeup without Retouch\n									</li>\n								<li >\n										Photoshoot\n									</li>\n						</ul>\n			<a href=\"http://localhost/wordpress/about/\" role=\"button\">\n						Book Now\n					</a>\n			<h2>$49</h2>		\n			<h2>Packages</h2>		\n					<ul>\n							<li >\n										For Bride\n									</li>\n								<li >\n										Trial Makeup\n									</li>\n								<li >\n										Trial Hairdo\n									</li>\n								<li >\n										Include Hairdo\n									</li>\n						</ul>\n			<a href=\"http://localhost/wordpress/about/\" role=\"button\">\n						Book Now\n					</a>\n			<h2>$99</h2>		\n			<h2>Packages</h2>		\n					<ul>\n							<li >\n										For Bride\n									</li>\n								<li >\n										For Bridesmaid\n									</li>\n								<li >\n										Trial Makeup\n									</li>\n								<li >\n										Include Hairdo\n									</li>\n						</ul>\n			<a href=\"http://localhost/wordpress/about/\" role=\"button\">\n						Book Now\n					</a>\n			<h3>Frequently asked questions</h3>		\n												<a href=\"\">I love your style! When should I book my wedding day services?</a>\n					<p>We would love for you to book your wedding day as soon as you have your date set. Most brides book 6 to 9 months out.</p>\n												<a href=\"\">Do you come to me on my wedding day?</a>\n					<p>Why, yes! Our services include travel to your your wedding location. Please inquire for travel fees outside the Portland metro area.</p>\n												<a href=\"\">Will you take before and after photos at my pre wedding trial?</a>\n					<p>Yes. Before and after pictures help you to see the difference that makeup and hair can make. We also keep your images on file to reference for your wedding day.</p>\n												<a href=\"\">Can you help me with coordinating my wedding day timeline?</a>\n					<p>Of course! Once all of the the services have been decided upon, you can make sure that your timeline will be tailored to you wedding day needs.</p>\n												<a href=\"\">May I do a pre-wedding trial before I commit?May I do a pre-wedding trial before I commit?</a>\n					<p>Absolutely! If you are unsure of who you would like to work with for your wedding day, then try different looks with other artists. We want you to be 100% sure of your decision. Please keep in mind that Kirstie cannot hold a date without a deposit and contract.</p>\n			<h3>Our clients say</h3>		\n							\'You are so amazing at what you do! Thank you so much for everything! I felt so beautiful on our wedding day. Not only are you superwoman with a makeup brush, you are so lovely and such a delight to have around the morning of the wedding!\n							<img width=\"660\" height=\"371\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/women.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/women.jpg 660w, http://localhost/wordpress/wp-content/uploads/2020/08/women-300x169.jpg 300w\" sizes=\"(max-width: 660px) 100vw, 660px\" />						\n														Belinda Alderson\n																						Bride\n							\'Thank you so very much for the amazing job you did for my wedding! I can\'t recommend you highly enough. Such an incredible talented makeup artist. Highly recommend Pretty Things for your special event.\'\'\n							<img width=\"626\" height=\"417\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/beautiful-young-blonde-caucasian-woman-with-wavy-hair-looking-her-shoulder_1098-17388.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/beautiful-young-blonde-caucasian-woman-with-wavy-hair-looking-her-shoulder_1098-17388.jpg 626w, http://localhost/wordpress/wp-content/uploads/2020/08/beautiful-young-blonde-caucasian-woman-with-wavy-hair-looking-her-shoulder_1098-17388-300x200.jpg 300w\" sizes=\"(max-width: 626px) 100vw, 626px\" />						\n														Jayne Russell\n																						Bride\n							\'If I could rate Rachel more than 5 stars I would! Rachel provided an excellent makeup service for me when competing. Not only is her work amazing she is a beautiful, friendly person who made me feel comfortable.\' \n							<img width=\"626\" height=\"437\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/beautiful-girl-blows-kiss-front_85574-10850.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/beautiful-girl-blows-kiss-front_85574-10850.jpg 626w, http://localhost/wordpress/wp-content/uploads/2020/08/beautiful-girl-blows-kiss-front_85574-10850-300x209.jpg 300w\" sizes=\"(max-width: 626px) 100vw, 626px\" />						\n														 Careen Killingbeck\n																						Fitness Model\n							From the trial to the actual wedding day, she was all over it. They responded so quickly to all my questions, did my makeup in 30 minutes flat and did exactly what I wanted. My make-up looked spectacular on the day and amazing in photos. \n							<img width=\"1000\" height=\"1500\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/photo-1529626455594-4ff0802cfb7e.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/photo-1529626455594-4ff0802cfb7e.jpg 1000w, http://localhost/wordpress/wp-content/uploads/2020/08/photo-1529626455594-4ff0802cfb7e-200x300.jpg 200w, http://localhost/wordpress/wp-content/uploads/2020/08/photo-1529626455594-4ff0802cfb7e-683x1024.jpg 683w, http://localhost/wordpress/wp-content/uploads/2020/08/photo-1529626455594-4ff0802cfb7e-768x1152.jpg 768w\" sizes=\"(max-width: 1000px) 100vw, 1000px\" />						\n														Kate Haidar\n																						Bride', 'Book Online', '', 'publish', 'closed', 'closed', '', 'book-online', '', '', '2020-08-06 03:23:26', '2020-08-06 03:23:26', '', 0, 'http://localhost/wordpress/?page_id=27', 0, 'page', '', 0),
