(135, 1, '2020-08-04 08:41:32', '2020-08-04 08:41:32', '<h3>\n					About Pretty Things\n				</h3>\n								<p>Pretty Things\' unique, open-sell environment features an ever-increasing amount of classic and emerging brands across a broad range of product categories including skincare, makeup, fragrance, body and hair care, in addition to Pretty Things\' own private label.<br style=\"color: rgb(0, 0, 0); font-family: &quot;Sephora Sans&quot;, CenturyGothic, Helvetica, Arial; font-size: 13px; letter-spacing: 0.3px; text-align: justify; white-space: normal;\"><br style=\"color: rgb(0, 0, 0); font-family: &quot;Sephora Sans&quot;, CenturyGothic, Helvetica, Arial; font-size: 13px; letter-spacing: 0.3px; text-align: justify; white-space: normal;\">Today, Pretty Things is not only the leading chain of perfume and cosmetics stores in France, but also a powerful beauty presence in countries around the world.</p>\n										<img width=\"572\" height=\"555\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/study_1.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/study_1.jpg 572w, http://localhost/wordpress/wp-content/uploads/2020/08/study_1-300x291.jpg 300w\" sizes=\"(max-width: 572px) 100vw, 572px\" />											\n			<h3>our Beauty team</h3>		\n										<img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/Charlotte-Tilbury-150x150.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/Charlotte-Tilbury-150x150.jpg 150w, http://localhost/wordpress/wp-content/uploads/2020/08/Charlotte-Tilbury-300x300.jpg 300w, http://localhost/wordpress/wp-content/uploads/2020/08/Charlotte-Tilbury-768x768.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/08/Charlotte-Tilbury.jpg 900w\" sizes=\"(max-width: 150px) 100vw, 150px\" />											\n			<h2>Charlotte Tilbury</h2>		\n			<h2>Make-up artist</h2>		\n		<p>is a British make-up artist, founder, chairman, president and chief creative officer of her eponymous makeup and skincare brand, Charlotte Tilbury Beauty Ltd.</p>		\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook-f\n									</a>\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n									</a>\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Linkedin\n									</a>\n										<img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/Untitled-w-150x150.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/Untitled-w-150x150.jpg 150w, http://localhost/wordpress/wp-content/uploads/2020/08/Untitled-w-300x300.jpg 300w, http://localhost/wordpress/wp-content/uploads/2020/08/Untitled-w.jpg 500w\" sizes=\"(max-width: 150px) 100vw, 150px\" />											\n			<h2>Marie Robinson</h2>		\n			<h2>Hairstylist</h2>		\n		<p>Considered by many as the best colorist in NYC, Marie Robinson owes her long list of A-list patrons to her unmatched talent and warm personality.</p>		\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook-f\n									</a>\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n									</a>\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Linkedin\n									</a>\n										<img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/LLISA-E-3089018ed68942a7aa274b7f6d548337-150x150.jpg\" alt=\"\" />											\n			<h2>Lisa Eldrige</h2>		\n			<h2>Make-up Reviewer</h2>		\n		<p>is an English-New Zealand make-up artist, businesswoman, author, and YouTuber.<sup id=\"cite_ref-BusinessofFashion_1-0\"></sup> She had her first big break when she was booked by<i><a title=\"Elle (magazine)\" href=\"https://en.wikipedia.org/wiki/Elle_(magazine)\">Elle</a></i>magazine to work with model<a title=\"Cindy Crawford\" href=\"https://en.wikipedia.org/wiki/Cindy_Crawford\">Cindy Crawford</a>.</p>		\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook-f\n									</a>\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n									</a>\n							<a target=\"_blank\" rel=\"noopener noreferrer\">\n					Linkedin\n									</a>\n										<img width=\"768\" height=\"543\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/secondary-visuals-2c-make-up-for-ever.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/secondary-visuals-2c-make-up-for-ever.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/08/secondary-visuals-2c-make-up-for-ever-300x212.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n			<h3>\"Beautiful Makeup starts with Beautiful Skin\"</h3>		\n		<p>The skin is endowed with many functions to preserve its beauty. But one thing it cannot do is cleanse itself. \"Cleansing is the first and the last step of makeup. This idea is at the heart of our brand philosophy:<br />beautiful makeup starts with beautiful skin.</p>		\n			<h3>\"Beauty brings joy to people\"</h3>		\n		<p>More than a style signature, a vanguard attitude towards fashion and beauty. A trend-setting approach, harmoniously blending fun, fearlessness and sophistication, always with a twist and an element of surprise. To us, makeup is a territory of exploration to further express ones singularity and style.</p>		\n										<img width=\"768\" height=\"543\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/secondary-visuals-1c-make-up-for-ever.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/secondary-visuals-1c-make-up-for-ever.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/08/secondary-visuals-1c-make-up-for-ever-300x212.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" />', 'About', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2020-08-04 08:41:32', '2020-08-04 08:41:32', '', 25, 'http://localhost/wordpress/2020/08/04/25-revision-v1/', 0, 'revision', '', 0),
(136, 1, '2020-08-05 10:11:09', '2020-08-05 10:11:09', '<h5>DISCOVER YOUR NEW ADDICTION</h5>\n<h3>Skin Loving, Earth Saving</h3>\n<a href=\"http://localhost/wordpress/about/\" role=\"button\">\nBook Online\n</a>\n\nPretty Things\n<h3>Seasonal\nEssentials</h3>\n<img width=\"819\" height=\"1024\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/e0e3ae4efc873490037b14e4d5a02097-819x1024.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/e0e3ae4efc873490037b14e4d5a02097-819x1024.jpg 819w, http://localhost/wordpress/wp-content/uploads/2020/08/e0e3ae4efc873490037b14e4d5a02097-240x300.jpg 240w, http://localhost/wordpress/wp-content/uploads/2020/08/e0e3ae4efc873490037b14e4d5a02097-768x960.jpg 768w, http://localhost/wordpress/wp-content/uploads/2020/08/e0e3ae4efc873490037b14e4d5a02097.jpg 1080w\" sizes=\"(max-width: 819px) 100vw, 819px\">\n<img width=\"683\" height=\"1024\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/Dr.-Brandt-Retinol-Serum-Eye-Cream-036-683x1024.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/Dr.-Brandt-Retinol-Serum-Eye-Cream-036-683x1024.jpg 683w, http://localhost/wordpress/wp-content/uploads/2020/08/Dr.-Brandt-Retinol-Serum-Eye-Cream-036-200x300.jpg 200w, http://localhost/wordpress/wp-content/uploads/2020/08/Dr.-Brandt-Retinol-Serum-Eye-Cream-036.jpg 760w\" sizes=\"(max-width: 683px) 100vw, 683px\">\n\n2% Retinol Complex Serum\nNighttime skin renewal\n\nby dr. brandt\n\n<img src=\"http://localhost/wordpress/wp-content/uploads/elementor/thumbs/pro-finish-product-shot-otgncpxo4d28um7ms0vi65ygi5gjfl8cl0nb6wxsw8.jpg\" title=\"pro-finish-product-shot\" alt=\"pro-finish-product-shot\">\n<h1>Revolutionary Compact Powder Foundation: Pro&nbsp;Finish</h1>', 'Home', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2020-08-05 10:11:09', '2020-08-05 10:11:09', '', 66, 'http://localhost/wordpress/2020/08/05/66-revision-v1/', 0, 'revision', '', 0),
