, http://localhost/wordpress/wp-content/uploads/2020/08/1596624574857-300x222.jpg 300w\" sizes=\"(max-width: 615px) 100vw, 615px\" /></a>\n			</figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"342af2fd\" data-elementor-lightbox-title=\"1596624522507\" href=\'http://localhost/wordpress/wp-content/uploads/2020/08/1596624522507.jpg\'><img width=\"631\" height=\"476\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/1596624522507.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/1596624522507.jpg 631w, http://localhost/wordpress/wp-content/uploads/2020/08/1596624522507-300x226.jpg 300w\" sizes=\"(max-width: 631px) 100vw, 631px\" /></a>\n			</figure><figure class=\'gallery-item\'>\n				<a data-elementor-open-lightbox=\"yes\" data-elementor-lightbox-slideshow=\"342af2fd\" data-elementor-lightbox-title=\"1596624635312\" href=\'http://localhost/wordpress/wp-content/uploads/2020/08/1596624635312.jpg\'><img width=\"526\" height=\"356\" src=\"http://localhost/wordpress/wp-content/uploads/2020/08/1596624635312.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2020/08/1596624635312.jpg 526w, http://localhost/wordpress/wp-content/uploads/2020/08/1596624635312-300x203.jpg 300w\" sizes=\"(max-width: 526px) 100vw, 526px\" /></a>\n			</figure>', 'Portfolio', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2020-08-05 10:52:43', '2020-08-05 10:52:43', '', 26, 'http://localhost/wordpress/2020/08/05/26-revision-v1/', 0, 'revision', '', 0),
